CREATE EXTENSION IF NOT EXISTS timescaledb;

CREATE TABLE ship (
  id SERIAL PRIMARY KEY NOT NULL,
  ship_uuid UUID NOT NULL UNIQUE
);

CREATE TABLE speed_through_water_measurement (
  time TIMESTAMPTZ NOT NULL,
  ship_id INTEGER NOT NULL,
  nautical_mile_per_hour DOUBLE PRECISION NOT NULL,
  FOREIGN KEY (ship_id) REFERENCES ship (id)
);

SELECT create_hypertable('speed_through_water_measurement', 'time', 'ship_id', 5);
ALTER TABLE speed_through_water_measurement
  ADD CONSTRAINT stw_unique_ship UNIQUE (time ,ship_id);


